import { useEffect } from "react";
import getInf from "../../hooks/useApi";
import Card from "../Card/Card";
import "./Cards.css";

function Cards(){
    var lista = [];

    useEffect(() => {
        getInf()
            .then((response) => {
                lista = response.data.entries;
                console.log(lista);
            });
    }, []);

    useEffect(() =>{

    }, [lista]);

    return (
        <div className="Cards">
      
            {lista.map(function(item, i){
                return (
                    <div className="CardsContainer">
                        <Card titulo={item.titulo} subtitulo={item.subtitulo} preco={item.preco}/>
                    </div>
                )
            })}
        </div>
    );
}

export default Cards;
